import React from "react";

function reverse(str){
  var reversed = "";
  for (let i = str.length - 1; i >= 0; i--){
    reversed += str[i];
  }
  return reversed;
}

const Bubble = (props) => {
  return(
    <div className="bubble-container">
      <div>
        <h3>string: </h3>
        <p>{reverse(props.inputstring)}</p>
      </div>

		</div>
  );
}

export default Bubble;
